import React , {useState} from "react";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import axios from "axios";

function App() {


  const [user , setUser] = useState({
   name:"" ,  email : "" , pass :""

  });

  let name,value ;

const handleInputs = (e) => {
  console.log(e);
  name=e.target.name;
  value=e.target.value;

  setUser({ ...user , [name]:value});
}



function PostData(e){
  e.preventDefault();


 axios.post("/register" , user)
  .then(function(response){

    console.log(response);
    window.alert("done");


  }).catch((err)=>{
    console.log(err);
  })

}



  return (
  <>


    <div id="samarth" >
    <input type="text" onChange={handleInputs} placeholder="enter your name" name="name" />

    <input type="email" onChange={handleInputs} placeholder="enter your name" name="email" />


    <input type="password" onChange={handleInputs} placeholder="enter your name" name="pass" />

    <input  type="submit" className="btn" id="Aditya" 
                onClick={PostData} />


 </div>

  </>
  );
}
export default App;
